import React from "react";
import { Link } from "react-router-dom";

const Priceprops = (abc) => {
  return (
    <>
      <div className="price-inner-child">
        <div className="pc">
          <div className="price-child c1">
            <div className="text">
              <h2>{abc.title}</h2>
              <span>^{abc.p}</span>
              <Link to="#">choose</Link>
            </div>
          </div>
          <div className="price-child c2">
            <ul style={{ listStyleType: "none" }}>
              <li>car wash & polishing</li>
              <li>water wash & oil level</li>
              <li>wheel & steering checkup</li>
              <li> brake adjustment</li>
              <li>cambelt replacement</li>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
};

export default Priceprops;
